module.exports = "<h2><a id=\"user-content-purpose\" class=\"anchor\" href=\"#purpose\" aria-hidden=\"true\"><svg aria-hidden=\"true\" class=\"octicon octicon-link\" height=\"16\" version=\"1.1\" viewBox=\"0 0 16 16\" width=\"16\"><path d=\"M4 9h1v1h-1c-1.5 0-3-1.69-3-3.5s1.55-3.5 3-3.5h4c1.45 0 3 1.69 3 3.5 0 1.41-0.91 2.72-2 3.25v-1.16c0.58-0.45 1-1.27 1-2.09 0-1.28-1.02-2.5-2-2.5H4c-0.98 0-2 1.22-2 2.5s1 2.5 2 2.5z m9-3h-1v1h1c1 0 2 1.22 2 2.5s-1.02 2.5-2 2.5H9c-0.98 0-2-1.22-2-2.5 0-0.83 0.42-1.64 1-2.09v-1.16c-1.09 0.53-2 1.84-2 3.25 0 1.81 1.55 3.5 3 3.5h4c1.45 0 3-1.69 3-3.5s-1.5-3.5-3-3.5z\"></path></svg></a>Purpose</h2>\r\n\r\n<p>Meetings are the heart and soul of democracy. They are where people of different opinions listen to others and present their points of view. In early democracy, it was physically possible for most citizens to all attend at once. </p>\r\n\r\n<p>In the Athenian Assembly of 500 BC, a quorum of 6,000 of the 43,000 citizens was needed to conduct business. In the 10th century, the yearly Icelandic Althing was held in a natural outdoor amphitheater for two weeks and all citizens could attend.</p>\r\n\r\n<p>Today it is rare to see more than a dozen citizens at a council meeting in a town of 30,000 people. Is this still democracy? Even finding out what was said at these meetings is difficult to impossible. The vast majority do not even produce a transcript.</p>\r\n\r\n<p>Most only produce “minutes”, which is a list of the topics discussed and actions taken. If there is a transcript, it is usually difficult to access and read. You need to download it. There is never a table of contents. Finding anything in it is very difficult. </p>\r\n\r\n<p>This project attempt to obtain transcripts as soon as possible after meetings conclude. It then processes the transcripts, extracts the information and makes it available in a very user friendly way. </p>\r\n\r\n<h2><a id=\"user-content-features\" class=\"anchor\" href=\"#features\" aria-hidden=\"true\"><svg aria-hidden=\"true\" class=\"octicon octicon-link\" height=\"16\" version=\"1.1\" viewBox=\"0 0 16 16\" width=\"16\"><path d=\"M4 9h1v1h-1c-1.5 0-3-1.69-3-3.5s1.55-3.5 3-3.5h4c1.45 0 3 1.69 3 3.5 0 1.41-0.91 2.72-2 3.25v-1.16c0.58-0.45 1-1.27 1-2.09 0-1.28-1.02-2.5-2-2.5H4c-0.98 0-2 1.22-2 2.5s1 2.5 2 2.5z m9-3h-1v1h1c1 0 2 1.22 2 2.5s-1.02 2.5-2 2.5H9c-0.98 0-2-1.22-2-2.5 0-0.83 0.42-1.64 1-2.09v-1.16c-1.09 0.53-2 1.84-2 3.25 0 1.81 1.55 3.5 3 3.5h4c1.45 0 3-1.69 3-3.5s-1.5-3.5-3-3.5z\"></path></svg></a>Features</h2>\r\n\r\n<p>Shortly after a government meeting takes place, you will be able to:</p>\r\n\r\n<ul>\r\n<li>Go online and see what issues were discussed and exactly what was said and by whom.</li>\r\n<li>Receive, on your phone or via email, a summary of issues discussed. </li>\r\n<li>Receive a phone alert or email whenever a specific issue is discussed. You would sign up prior for alerts.</li>\r\n</ul>\r\n\r\n<p>At any time, you can go online and see:</p>\r\n\r\n<ul>\r\n<li>See all issues discussed in past meetings.</li>\r\n<li>See all that was said in the past on any specific issue.</li>\r\n<li>See exactly what any specific official said on any specific issue. This is especially helpful at election time.</li>\r\n</ul>\r\n\r\n<h2><a id=\"user-content-design\" class=\"anchor\" href=\"#design\" aria-hidden=\"true\"><svg aria-hidden=\"true\" class=\"octicon octicon-link\" height=\"16\" version=\"1.1\" viewBox=\"0 0 16 16\" width=\"16\"><path d=\"M4 9h1v1h-1c-1.5 0-3-1.69-3-3.5s1.55-3.5 3-3.5h4c1.45 0 3 1.69 3 3.5 0 1.41-0.91 2.72-2 3.25v-1.16c0.58-0.45 1-1.27 1-2.09 0-1.28-1.02-2.5-2-2.5H4c-0.98 0-2 1.22-2 2.5s1 2.5 2 2.5z m9-3h-1v1h1c1 0 2 1.22 2 2.5s-1.02 2.5-2 2.5H9c-0.98 0-2-1.22-2-2.5 0-0.83 0.42-1.64 1-2.09v-1.16c-1.09 0.53-2 1.84-2 3.25 0 1.81 1.55 3.5 3 3.5h4c1.45 0 3-1.69 3-3.5s-1.5-3.5-3-3.5z\"></path></svg></a>Design</h2>\r\n\r\n<ul>\r\n<li>A front-end based on AngularJS.</li>\r\n<li>A back-end based on C# and ASP.NET</li>\r\n<li>An SQL database with Entity Framework as the Object-Relational mapping.</li>\r\n</ul>\r\n\r\n<p>If transcipts already exist, the above is all that is needed. However, for places where they do not exist, this project aims to build a system for generating transcripts from video recordings.</p>\r\n\r\n<p>The design information can be found in the Wiki tab above or click here: <a href=\"https://github.com/govmeeting/govmeeting/wiki/Design-Documentation\">WIKI Design Documentation.</a></p>\r\n\r\n<h2><a id=\"user-content-goals\" class=\"anchor\" href=\"#goals\" aria-hidden=\"true\"><svg aria-hidden=\"true\" class=\"octicon octicon-link\" height=\"16\" version=\"1.1\" viewBox=\"0 0 16 16\" width=\"16\"><path d=\"M4 9h1v1h-1c-1.5 0-3-1.69-3-3.5s1.55-3.5 3-3.5h4c1.45 0 3 1.69 3 3.5 0 1.41-0.91 2.72-2 3.25v-1.16c0.58-0.45 1-1.27 1-2.09 0-1.28-1.02-2.5-2-2.5H4c-0.98 0-2 1.22-2 2.5s1 2.5 2 2.5z m9-3h-1v1h1c1 0 2 1.22 2 2.5s-1.02 2.5-2 2.5H9c-0.98 0-2-1.22-2-2.5 0-0.83 0.42-1.64 1-2.09v-1.16c-1.09 0.53-2 1.84-2 3.25 0 1.81 1.55 3.5 3 3.5h4c1.45 0 3-1.69 3-3.5s-1.5-3.5-3-3.5z\"></path></svg></a>Goals</h2>\r\n\r\n<p>The first goal is to build a working system for those towns or cities that provide online transcripts. Specifically, the first test place will be Philadelphia, PA. USA.</p>\r\n\r\n<p>The next goal is to build the system for converting video recordings into transcipts.</p>\r\n\r\n<p>People throughout the world deal with the same problems. This software will be designed to be used anywhere, wherever there is democracy and public access to government meetings.</p>\r\n\r\n<p>Perhaps once the software is working at the town and city level, we can look into expanding to state and federal government bodies.</p>\r\n"

