module.exports = "<p>\r\n  <br /><h1> Govmeeting - Access to your town or city council meetings </h1>\r\n<p>\r\n\r\n<!--<markdown>\r\n  ## Test of Markdown h2 content\r\n</markdown>-->\r\n\r\n<h2> Using this site, you will be able to: </h2>\r\n<ul>\r\n  <li>\r\n    Browse transcripts of your town or city meetings. Browse by subject, speaker, etc. <a href=\"meeting\">Browse meetings </a>\r\n  </li>\r\n  <li>\r\n    Be notified when a specific topic is discussed at future meetings: <a href=\"updates\">Notifications</a></li>\r\n</ul>\r\n\r\n<h2> How it works: </h2>\r\n\r\n<ul>\r\n  <li>\r\n    Anyone can register their town or city to have their meeting information available here: <a href=\"registerGov\">Register my town or city</a>\r\n  </li>\r\n</ul>\r\n<p> Sometimes your town or city may provide transcripts of meeetings. Sometimes only a video recording is available. At other times, neither may be available.\r\nWe try to cover all three situations. </p>\r\n<ul>\r\n  <li>\r\n    When only recordings of meeting are available, we will auto transcribe the recording. Volunteers will then proof-read the transcription.: <a href=\"fixasr\">Proof-read transcripts </a>\r\n  </li>\r\n  <li>\r\n    Volunteers will tag the transcript with appropriate subject names: <a href=\"addtags\">Tag transcripts</a>\r\n  </li>\r\n  <li>\r\n    If neither online recordings or transcripts, a volunteer can use our mobile app to record a meeting and upload it: <a href=\"record\">Record meeting</a>\r\n  </li>\r\n</ul>\r\n\r\n\r\n<h2> Become involved! </h2>\r\n\r\n<h3> Community Activists</h3>\r\n\r\n<ul>\r\n<li>\r\n  Register your town or city to participate: <a href=\"registerGov\">Register my town or city</a>\r\n</li>\r\n<li>\r\n  Register as a volunteer to proof-read and tag transcripts: <a href=\"register\">Register</a>\r\n</li>\r\n</ul>\r\n<h3> Software Developers</h3>\r\n\r\nPlease join us! The front end is written in Javascript/Typescript with Angular. The server code is in C# with Asp.Net Core.\r\nSee: <a href=\"http://github.com/govmeeting/govmeeting\">github.com/govmeeting/govmeeting</a><br>\r\n\r\n\r\n<!--\r\n\r\n  Governing board meetings are where votes are cast on and citizens have the chance to address their representatives.\r\n  The vast majority of citizens rely on the news media to report on important issues. But there is\r\n  a danger in doing this. News outlets will naturally choose the issues that they feels are important.\r\n  They only have space or time to discuss a fraction of what occurred.\r\n  Some few citizes may take the time to access the meeting minutes. But even they will find only\r\n  filtered information. The minutes may only say \"Some residents voiced concern obout this issue\". But in fact,\r\n  there may have been vociforous opposition that was voiced.\r\n\r\n-->\r\n"

